discord.com.css:
@font-face {
    font-family: gitbook-content-font,-apple-system,BlinkMacSystemFont,"Segoe UI",Helvetica,Arial,sans-serif !important;
    src: url("https://justauramo.github.io/unisans/UniSansBold.ttf");
    font-weight: 600;
}
:root {
    --font-primary: gitbook-content-font,-apple-system,BlinkMacSystemFont,"Segoe UI",Helvetica,Arial,sans-serif !important;
    font-weight: 600;
}

/* User Roles */
.role__631a3 {
	position: relative;
	overflow: hidden;
	/* background: transparent; */
	border: none;
	border-color: transparent;
	border-radius: 0px 2px 2px 0px;
	margin: 0px 4px 3px 0px;
	padding: 0px 2px 0px 2px;
}
.theme-light .role__631a3 {
	background-color: var(--profile-role-pill-background-color);
}
.role__631a3 .roleCircle_bae511:before {
	content: '';
	position: absolute;
	background: inherit;
	width: 100%;
	height: 100%;
	left: 0px;
	opacity: 0.6;
}
.role__631a3 .roleRemoveIcon__7f63d {
	margin: 0px;
	left: unset;
	transform: translate(0%,-50%);
}
.role__631a3 .roleRemoveButton__737f2 {
	position: static;
}
/* Custom Role Icon */
.role__631a3 .roleIcon__7599e {
	margin-left: -2px;
	margin-right: 6px;
	z-index: 1;
}
/* Role Remove Button */
.role__631a3 .roleCircle_bae511 {
	border-radius: 0px;
	margin-left: -2px;
	margin-right: 6px;
	width: 3px;
	height: 22px;
	opacity: 0.6;
}
.userPopoutOuter_d739b2 .role__631a3:hover,
.customScroller_f72801 .role__631a3:hover {
	padding: 0px 0px 0px 0px;
}
.userPopoutOuter_d739b2 .actionButton__81eaa:hover,
.customScroller_f72801 .actionButton__81eaa:hover {
	padding: 0px 2px 0px 2px !important;
}
.userPopoutOuter_d739b2 .role__631a3:hover .roleCircle_bae511,
.customScroller_f72801 .role__631a3:hover .roleCircle_bae511 {
	width: 12px;
	height: 12px;
	margin: 0px 3px 0px 2px;
	border-radius: 50%;
	opacity: 1;
}
.userPopoutOuter_d739b2 .role__631a3:hover .roleRemoveIcon__7f63d,
.customScroller_f72801 .role__631a3:hover .roleRemoveIcon__7f63d {
	width: 12px;
	height: 12px;
	margin-left: 2px;
}
/* Role Add Button */
.role__631a3.actionButton__81eaa:before {
	content: '';
	position: absolute;
	border-width: 12px;
	border-style: solid;
	border-color: inherit;
}
.theme-light .role__631a3.actionButton__81eaa:before {
	border-color: transparent;
}
.role__631a3.actionButton__81eaa {
	border-color: #333333;
}
.role__631a3.actionButton__81eaa:hover {
	border-color: #444444;
}
.role__631a3.actionButton__81eaa .addButtonIcon__6a05a {
	filter: drop-shadow(-1px 1px 0px #191919);
	width: 16px;
}
/* Role Add Button: Hover */
.userPopoutOuter_d739b2 .roles__74a2b .role__631a3.actionButton__81eaa {
	border-radius: 2px;
	display: none;
}
.userPopoutOuter_d739b2 .roles__74a2b:hover .role__631a3.actionButton__81eaa {
	display: flex;
}
/* Text */
.role__631a3 .roleName_d19d33 {
	margin: 0px 2px 0px -2px;
	overflow: visible;
	z-index: 1;
}
.userPopoutOuter_d739b2.theme-light .roleName_d19d33 .defaultColor__77578 {
	color: #000000;
	text-shadow: -1px 1px 2px rgba(0,0,0,0.2);
}
.userPopoutOuter_d739b2.theme-dark .roleName_d19d33,
.customScroller_f72801 .role__631a3 .roleName_d19d33 {
	color: #FFFFFF;
	text-shadow: -1px 1px 2px rgba(0,0,0,0.6);
}

/* Server Management Popout (User Roles, Audit log Filter) */
.container_d27846 {
	background-color: #191919;
	box-shadow: var(--elevation-stroke),var(--elevation-high);
	border: none;
	padding-bottom: 0px;
}
.container_d27846 .inner__999f6 {
	background-color: #141414;
}
.container_d27846 .list__9970c {
	padding: 0px 0px 4px 0px;
}
.container_d27846 .list__9970c .item__287de:hover {
	background-color: #161616;
}
.container_d27846 .list__9970c .selected__511cf {
	background-color: #141414;
}
.container_d27846 .list__9970c .selectedBrand__37ae4,
.container_d27846 .list__9970c .selectedBrand__37ae4:hover {
	background:var(--bd-blue);
}
.container_d27846 .list__9970c .popoutRoleDot_ca67e0 {
	border: none;
}

/* View User Permissions Plugin: User Popout */
.userPopoutOuter_d739b2 #permissions-popout {
	width: calc(var(--User-Popout-Width) - 14px);
	margin-bottom: 12px;
}
.userPopoutOuter_d739b2 #permissions-popout .endBodySection-ypd-38 {
	width: calc(var(--User-Popout-Width) - 8px);
}
.userPopoutOuter_d739b2 #permissions-popout .member-perms-title {
	text-transform: uppercase;
	font-weight: 700;
	font-size: 12px;
	line-height: 15px;
